import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

export default function BasicTextFields() {
  return (
    
    <Box>
    
      component="form"
      sx={{
        '& > :not(style)': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    
    <h2>Ingredients</h2>
      <TextField id="outlined-basic" label="Ingredient1" variant="outlined" />
      <TextField id="outlined-basic" label="Ingredient2" variant="outlined" />
      <TextField id="outlined-basic" label="Ingredient3" variant="outlined" />
      <TextField id="outlined-basic" label="Ingredient4" variant="outlined" />
      <TextField id="outlined-basic" label="Ingredient5" variant="outlined" />

    </Box>
  );
}
